import React from 'react'
import Slider from "react-slick";
import './Review.css'

const Review = () => {
    const settings = {
        dots: true,
        infinite:true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
      };
  return (
    <div className="review-box">
        <h2>Reviews</h2>
        <div className="img-slider">
        <Slider {...settings}>
      <div>
         <img src="./Images/Group 29.png"></img>
      </div>
      <div>
      <img src="./Images/Group 29.png"></img>
      </div>
      <div>
      <img src="./Images/Group 29.png"></img>
      </div>

    </Slider>
    </div>
    </div>
  );
}

export default Review


